import React from 'react';
import ReactDOM from 'react-dom/client';
const myElement = (
    <>
        <p>This is a paragraph.</p>
        <p>This is another paragraph.</p>
    </>
);
const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(myElement);
